   "source": [
    "<font size =\"5\"> **Introduction and background of the Company** </font>\n",
    "\n",
    "   Urška Sršen and Sando Mur founded Bellabeat, a high-tech company that manufactures health-focused smart products. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women.\n",
    "   \n",
    "   The company has invested in traditional advertising media, such as radio, out-of-home billboards, print, and television, but focuses on digital marketing extensively.Sršen knows that an analysis of Bellabeat’s available consumer data would reveal more opportunities for growth. She has asked the marketing analytics team to focus on a Bellabeat product and analyze smart device usage data in order to gain insight into how people are already using their smart devices. Then, using this information, she would like high-level recommendations for how these trends can inform Bellabeat marketing strategy."
   ]
  },
  {
   "cell_type": "markdown",
   "id": "c8b60701",
   "metadata": {
    "papermill": {
     "duration": 0.004568,
     "end_time": "2023-10-09T08:05:50.486920",
     "exception": false,
     "start_time": "2023-10-09T08:05:50.482352",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "<font size=\"5\"> **Question for Analysis** </font>\n",
    "\n",
    "1. What are some trends in smart device usage?\n",
    "2. How could these trends apply to Bellabeat customers?\n",
    "3. How could these trends help influence Bellabeat marketing strategy?"
   ]
  },
