    "<font size=\"5\"> **Fixing Formatting** </font>\n",
    "\n",
    "There is some problem in the timestamp of the data. So before we analyze the data, we need to fix this problem. To do so, I need to convert the _date time_ and split them to date and time."
   ]
  },
