   "source": [
    "**Interesting facts we find from our summary:**\n",
    "\n",
    "* Majority of the people lightly active.\n",
    "* The average of sleeping time of the participants in 1 sleep is 7 hours which is normal for adults according to Mayo Clinic [website](https://www.mayoclinic.org/healthy-lifestyle/adult-health/expert-answers/how-many-hours-of-sleep-are-enough/faq-20057898) .\n",
    "* The average sedentary time of the participants is 991.2 minutes (16.52 hours). This is too much and it needs to be reduced.\n",
    "* The average BMI of the participants is 25.19. A BMI over 25 is considered overweight and this is not a good sign.\n",
    "* The average total steps of all participants per day is 7638. According to [CDC research](https://www.medicalnewstoday.com/articles/how-many-steps-should-you-take-a-day#for-general-health), 10,000 steps per day is the recommended number for adults."
   ]
