    "The relationship between Total Minutes Asleep and Total Minutes in Bed is almost linear. This is because of course the more we sleep, the more time our bodies are in bed. **So if Bellabeat wants users to improve their sleep, they must make an update on their device that can give users a notification to go to sleep.**"
