   "source": [
    "* In the plot, we can see that there is a negative relationship between Sedentary minutes and Total Minutes Sleep.\n",
    "* This plot tells us that the higher time we are sedentary leads us to lower time our body asleep.\n",
    "* **If Bellabeat wants us to improve our sleep, Their app can recommend us to reduce the sedentary time**.\n",
    "* Sometimes correlation between data doesn't mean causation so we need to support this insights with more data."
   ]
