    "tags": []
   },
   "source": [
    "As we learn from the company, Bellabeat helps women motivates and helps their users become more healthier in their habits and more active in their daily lives. Bellabeat started in 2013 and since then their device quickly grows and it is now known as one of the recommended wellness company for women.\n",
    "\n",
    "After studying and anlyzing the FitBit Fitness Tracker Data, this is **some of my takes and insights that can help Bellabeat's marketing strategy**.\n",
    "\n",
    "\n",
    "\n",
    "**Target Audience**\n",
    "\n",
    "We focus on the women who work full-time for 8 hours in a day (according to the hours intensity data). This women spend a lot of time sedentary because they are focused on the work they are doing. The reason for this is they tend to sit or lying down more rather than walking and other more intense activity because they are on their computer or maybe in a meeting (according to the sedentary time data).\n",
    "\n",
    "According to the data we analyze, the participants do some light activity to stay healthy (according to the activity type analysis). If they want to become more active and have better health, they need some knowledge and motivation about developing healthy habits and a boost to do more activity.\n",
    "\n",
    "* There is no information about the gender of the participants so I presume that all genders were presented and balanced in this data set.\n",
    "\n",
    "**Recommendation for the Online Campaign of Bellabeat**\n",
    "\n",
    "Bellabeat app is more than a fitness application. This is the user's coach for bringing healthy lifestyle and habits to its users. The app must help the user's fitness goals to achieve by giving them knowledge and motivating them through recommendations by reminding them through notifications.\n",
    "\n",
    "**Ideas and Suggestions for the Bellabeat App**\n",
    "\n",
    "1. According to the data, the average steps of their users is 7,638 which is lower to the recommended steps CDC stated in their [website](https://www.medicalnewstoday.com/articles/how-many-steps-should-you-take-a-day#for-general-health) which is 8,000 steps. According to the 2020 data of CDC, walking 8,000 steps per day had a 51% lower risk in all-cause and cardiovascular mortality. This trend continued with higher step counts, as participants who took 12,000 steps per day had a 65% lower risk of dying than those who took 8,000 or lower.\n",
    "\n",
    "2. If users want to lose weight, having a good knowledge in controlling daily calorie intake will give a huge help for losing weight. The Bellabeat app can give suggestions and ideas for low-calorie meal plan for its users.\n",
    "\n",
    "3. If users want to improve their sleep, Bellabeat app should consider to make a notification for users to go to bed.\n",
    "\n",
    "4. According to the Hourly Intensities Data, the hours most activity users make is in 5 to 7pm. This is maybe because this is the time people ususally finish their work and have their free time. Bellabeat can recommend its users to motivate them to go to the gym or go for a run or walk more.\n",
    "\n",
    "5. From the Total Minutes Asleep and Sedentry Minutes, we learn that higher sedentary time leads to lower minutes asleep. Bellabeat app can recommend the users reduce their sedentary time to improve their sleep quality.\n",
    "\n",
    "\n",
